from itertools import combinations

data_split = data.splitlines()
weights_y = [1] * len(data_split)
weights_x = [1] * len(data_split[0])
for i, line in enumerate(data_split):
    if all(c == "." for c in line):
        weights_y[i] = 1000000
for i in range(len(data_split[0])):
    if all(line[i] == "." for line in data_split):
        weights_x[i] = 1000000

galaxies = [
    (j, i)
    for i, line in enumerate(data_split)
    for j, c in enumerate(line)
    if c == "#"
]
sum_paths = 0
for (g1x, g1y), (g2x, g2y) in combinations(galaxies, 2):
    sum_paths += sum(weights_x[min(g1x, g2x):max(g1x, g2x)]) + sum(weights_y[min(g1y, g2y):max(g1y, g2y)])

print(sum_paths)